import React, { useState, useEffect } from 'react'


const UsersTable = () => {
    const [users, setUsers] = useState([])

    useEffect(() => {
      fetch('/users')
        .then(res => res.json())
        .then(data => setUsers(data))
        .catch(error => console.error(error))
    }, [])
  
    return (
        <div>
            <h1>Users Table</h1>
        </div>
    )
}

export default UsersTable
